import React, { Component } from 'react';
import { stats, config } from '../services/icons';

class Header extends Component {
  handleClick = ({ currentTarget: { id } }) => {
    console.log(id);
  }

  render() {
    return (
      <header>
        <button type="button" id="help" onClick={ this.handleClick }>?</button>
        <h1>Try Word</h1>
        <button type="button" id="stats" onClick={ this.handleClick }>{stats()}</button>
        <button type="button" id="settings" onClick={ this.handleClick }>{config()}</button>
      </header>
    );
  }
}

export default Header;
